import React from "react";
import "./styles.scss";

export const Coffeebay = () => {

    let orders = ["order 1", "order 2", "order 3"];
    let listItems = orders.map((orders) => {
        return <li>{orders}</li>
    });

    return (
        <div className="body">
            <h1>Coffeebay</h1>
            <ul>{listItems}</ul>
        </div>
    );
};
